<?php

$inputFile = fopen("sherlock_and_the_beast.txt", "r") or die("Unable to open file!");

$data = array();
while(!feof($inputFile)) {
    $data[] = fgets($inputFile);
}
fclose($inputFile);

for ($i = 1; $i < count($data); $i++) {
    echo satb(trim($data[$i])), "\n";
}

function satb($number)
{
    if ($number == 1) {
        return -1;
    }
    if ($number % 3 == 0) {
        return str_repeat('5', $number);
    }

    $offset = 0;
    for ($i = $number; $i > 0; $i--) {
        $offset++;
        if ($offset % 5 == 0 && (($number - $offset) % 3 == 0)) {
            return str_repeat('5', $number - $offset) . str_repeat('3', $offset);
        }
    }
    return -1;
}

